import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

import {Add , Sub, } from './App'

ReactDOM.render(
  <>
  <h1>Add is {Add(10,10)}</h1>
  <h1>Sub is {Sub(10,10)}</h1>
  <h1>Mul is {Mul(10,10)}</h1>
  <h1>Div is {Div(10,10)}</h1>
  </>,
  document.getElementById("root")
);
